import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Navbar from './Components/Navbar';
import Register from './Components/Register';

function App() {
  return (
    <Routes>
      <div className="App">
        <Navbar />

        <Switch>
          <Route path='/register'>
            <Register />
          </Route>
        </Switch>
      </div>
    </Routes>

  );
}

export default App;
